import Panel from "../core/panel.vue";
export default {
  components: {
    Panel
  },
  props: {
    showList: Object
  },
  data() {
    return {
      data0: "100% auto"
    };
  },
  computed: {
    isBackground() {
      if (!this.showList.bimg) {
        return `url(//img30.360buyimg.com/cf/jfs/t1/21460/6/7316/152429/5c6bc770E64cc1118/c54eb9896eb51b97.jpg)`;
      }
      return `url(${this.showList.bimg}) `;
    }
  }
};
